import React from "react";

import {
  SectionContainer,
  SectionTitle,
  SectionParagraf,
  SocialMediaContainer,
} from "./ContactMeElements";
import { RiLinkedinBoxLine } from "react-icons/ri";

const ContactMeComponent = () => {
  return (
    <SectionContainer>
      <SectionTitle> Where to find me? </SectionTitle>
      <SectionParagraf>
        {" "}
        You can find me on all this platforms and I am always willing to talk
        about anything{" "}
      </SectionParagraf>
      <SocialMediaContainer>
        <RiLinkedinBoxLine />
      </SocialMediaContainer>
    </SectionContainer>
  );
};

export default ContactMeComponent;
